import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  let getCalendarEventsUrl = "https://graph.microsoft.com/v1.0/me/calendarView?startDateTime=2020-07-27T00:00:00.0000000&endDateTime=2020-07-27T23:59:00.0000000&$select=subject,start,end";
  let addEventUrl = "https://graph.microsoft.com/v1.0/me/calendar/events";

  var events;
  fetch(getCalendarEventsUrl, {
    headers: {
      "Authorization": "eyJ0eXAiOiJKV1QiLCJub25jZSI6ImJyb3FzeU5fM1dJbzBBMVVQbW5GU1J6S3czblJYX3NYSlpZWXUxdXU0LWciLCJhbGciOiJSUzI1NiIsIng1dCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSIsImtpZCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSJ9..h6UfFd08psrA46-YMsNTk_HyvgPdAT5dqIi-JaYQSYJPgFQq9SHCCKu4ONcpBRiSPUQyF5F4W11bIBK7Id57zlhbSFPgDpUpeC4Uib9AmoGDYDYGvtqpXIlp5LEr0bn923fAkx5a0IVCwMn21F0dzUnFiL36whltEvfKjNHz4LxatWjv5O5kq3iqDJi-RCO4H0QwyAZ7fae8x1UOgaEkVFSefUf3o8Y3A_TcyhPSDqNJHXZiLIseVwoiQZqAmVDLnqJlpOgTbVhBjCcymXp1YXhs5YSBXlI057bcAa4Xs2wMZEYHf6vi_H_pQwbnkl_sA6PvRd55RIE1N1B9y1f1Rg"
    }
  }).then((response) => {
    response.json().then((body) => {
      events = body.value;
      console.log(events);
      events.forEach(element => {
        console.log(element.subject + " : " + element.start.dateTime + " to " + element.end.dateTime);
      });
    }).catch((err) => {
      console.log("Error in parsing json response: " + err);
    });
  }).catch((error) => {
    console.log("Error in calling graph API: " + error.message);
  });
  
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
